import { Col } from "react-bootstrap";
export default function Chat({ messages }) {
  return (
    <Col xs={12} xxl={9} className="d-flex flex-column align-items-center">
      {messages.map((message, index) => (
        <h2 key={index}>{message}</h2>
      ))}
    </Col>
  );
}
